Text=сђђсѓфсЃгсЂ» сѓйсЃІсЃЃсѓ»№╝Ђ сѓйсЃІсЃЃсѓ»сЃ╗сѓХсЃ╗сЃўсЃЃсѓИ\nсЃЏсЃЃсѓ░№╝Ђ\nсђђсѓесЃЃсѓ░сѓГсЃ*сЃфсѓбсЂФС#ЌсѓіУЙ╝сѓЊсЂа сѓфсЃгсЂЪсЂАсѓњ\n}ЁсЂ*сЂдсЂёсЂЪсЂ«сЂ»сђЂсѓесЃЃсѓ░сЃъсЃ*сЂ«'їЉ'ѕдсЂасЂ*сЂЪсђѓ\nсђђсЂЊсЂЊсЂЙсЂД'Ю#сЂЪсЂЈсЂ░сђЂсѓ#сѓФсѓцсЃЄсЃЃсѓГсѓњсЂЈсЂљсѓі\n'іюсЂЉсѓЇсЂасЂе№╝Ъ\n\nсђђжЮбуЎйсЂёсђЂсѓёсЂ*сЂдсѓёсѓЇсЂєсЂўсѓЃсЂфсЂёсЂІ№╝Ђ\nсђђсѓесЃЪсЃ╝сђЂС╗ісЂЎсЂљУАїсЂЈсЂІсѓЅ}ЁсЂ*сЂдсѓЇсѓѕ№╝Ђ
